import React from 'react'
import { NavContainer, NavUl, NavLi, NavLink } from './NavBar.elements'
import { useNavigate } from 'react-router-dom'

function NavBar() {

  let navigate = useNavigate();

  return (
    <NavContainer>
      <NavUl>
        <NavLi><NavLink href='#AboutPage'>About Me</NavLink></NavLi>
        <NavLi><NavLink href='#AboutPage'>My Work</NavLink></NavLi>
        <NavLi><NavLink href='#AboutPage'>Contact</NavLink></NavLi>
      </NavUl>
    </NavContainer>
  )
}

export default NavBar
